import { Link } from 'react-router-dom';

function Profile () {
    return(

    <div class = "button">
        <Link to="/">
          <button className = "app_bottomButtonleft">
            Home 
          </button>
        </Link>

        <Link to="/profile">
          <button className = "app_bottomButtonright">
            Profile 
          </button>
        </Link>
      </div>    

    ); 
}


export default Profile;
